-- ----------------------------
DROP TABLE IF EXISTS `rota`;
CREATE TABLE `rota` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '大网班表数据',
  `week` varchar(255) DEFAULT NULL COMMENT '星期',
  `time_stamp` varchar(255) NOT NULL DEFAULT '0' COMMENT '值班时间戳，主要根据此项筛选班表',
  `member_name` varchar(255) DEFAULT NULL COMMENT '值班人员id',
  `mp_alias` varchar(255) DEFAULT NULL COMMENT '前端别名',
  `monitor_post_name` varchar(255) DEFAULT NULL COMMENT '值班岗位id',
  `is_day` int(11) NOT NULL DEFAULT '0' COMMENT '1 白班 0 非白班（但也不一定是夜班）',
  `is_night` int(11) NOT NULL DEFAULT '0' COMMENT '1 夜班 0 非夜班（但也不一定是白班）',
  `sort_day` int(11) NOT NULL DEFAULT '10000000' COMMENT '白班顺序，若无则排到最后',
  `sort_night` int(11) NOT NULL DEFAULT '100000' COMMENT '白班顺序，若无则排到最后',
  `is_show_for_rotaListOrdinary_page` int(11) NOT NULL DEFAULT '1' COMMENT '是否在rotaListOrdinary显示该字段',
  `is_active` int(11) NOT NULL DEFAULT '0' COMMENT '1 激活 0 禁用',
  `monitorPost_type` varchar(255) DEFAULT NULL COMMENT '岗位类别',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '自动更新',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=72063 DEFAULT CHARSET=utf8 COMMENT='由于岗位信息是会变动的，因此需要将该表改造为，用于记录monitor_post表与member表之间的关联，但是由于该表会随时间变化，因此该表就变得有点像每天新增一个member_monitorPost表的感觉';

