DROP TABLE IF EXISTS `rotasituationrecordmanagement`;
CREATE TABLE `rotasituationrecordmanagement` (
  `ctrr_rsrm_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `ctrr_rsrm_name` varchar(255) DEFAULT NULL COMMENT '名称',
  `ctrr_rsrm_level` int(11) DEFAULT NULL COMMENT '级别：1-一级表、2-二级表、3-字段',
  `ctrr_rsrm_parent_id` int(11) DEFAULT NULL COMMENT '父id',
  `ctrr_rsrm_type` int(11) DEFAULT '1' COMMENT '类型：1-text、2-switch、3-select、6-单个时间',
  `ctrr_rsrm_valueFortype` varchar(255) DEFAULT NULL COMMENT '字段值：格式为逗号隔开的字符串；当字段类型为时switch时，可为：‘是，否’；当字段类型为select时，可为‘线路外力破坏，线路劣化，设备，网管，连接单元，其它’；当字段类型为date时，可为：时间范围（ctrr_rsrm_valueFortype = 字段1（开始时间），字段2（结束时间））、计算时长（ctrr_rsrm_valueFortype = 字段1（时间范围字段的ctrr_rsrm_id）、时间选择器（单个时间值，ctrr_rsrm_valueFortype = ''''）',
  `ctrr_rsrm_sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `ctrr_rsrm_tips` varchar(255) DEFAULT NULL COMMENT '字段填写提示/格式要求等',
  `ctrr_rsrm_is_needed` int(11) NOT NULL DEFAULT '0' COMMENT '是否必须字段：必填 1、非必填 0 （仅对字段有效）',
  `ctrr_rsrm_is_key` int(11) NOT NULL DEFAULT '0' COMMENT '是否主键性质的字段：比如工单ID，每张表格只能有一个主键类型字段',
  `ctrr_rsrm_is_active` int(11) NOT NULL DEFAULT '1' COMMENT '状态：1-正常、0-删除',
  `ctrr_rsrm_is_fixed` int(11) NOT NULL DEFAULT '0' COMMENT '是否重要字段：重要字段固定不可修改，1：固定，0：非固定',
  `ctrr_rsrm_remarks` varchar(255) DEFAULT NULL COMMENT '备注与说明',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '自动更新',
  PRIMARY KEY (`ctrr_rsrm_id`)
) ENGINE=InnoDB AUTO_INCREMENT=679 DEFAULT CHARSET=utf8;

