INSERT INTO `member` VALUES ('1874', '詹鹏飞', '13802881289', null, '0', '/public/uploads/imgs/head/1575207554.png', '/public/uploads/imgs/emoticon/默认表情包.jpg', '监控分析室', '主任', '男', '21160735', 'zhanpengfei', '	1、自动化运维方面：开展运维自动化体系规划及其推广运维；自动化平台promise、forward开发和运维；运维自动化工具集zabbix、ELK、Ansible部署、优化与维护；\n	2、devops方面：.	在中心、科室甚至移动云各个部门间，推动devops理念在移动云的落地实施；制定devops相关流程、规则，通过流程自动化上的技术支撑和工具支撑，实现移动云的持续集成、持续交付及持续部署能力；\n	3、其他：为运营分析开发提供手段支撑和数据支撑；开展新技术研究及其落地应用，提供运维技术支撑和团队创新动力。', '2019-10-21 10:09:13', '0000-00-00 00:00:00');
INSERT INTO `member` VALUES ('1875', '李洁琼', '13802881267', null, '0', '/public/uploads/imgs/head/1575207563.png', '/public/uploads/imgs/emoticon/默认表情包.jpg', '监控分析室\n', '分析组', '女', '21015342', 'lijieqiong3', '1、负责监控分析室工作质量分析与管控，对标先进，健全工作指标评估体系；\n2、负责国际光传送网、云数据中心、西藏省网网络分析，挖掘问题隐患，联合开展网络优化 ；\n3、负责云数据中心投诉集中处理点的管理，包括客户投诉/服务请求/咨询的协调管理及质量把控、工单处理、信息发布管理、服务质量分析、培训及考核等；\n4、负责牵头开展网管支撑中心各专业应急保障工作，包括事前组织方案，事中协调支撑，事后评估优化；\n5、负责监控分析室综合支撑服务，包括班组文化建设、材料编写、信息报送、流程管理、文档管理、新闻宣传、后勤保障等。', '2019-10-21 10:09:13', '2020-01-19 14:49:52');
INSERT INTO `member` VALUES ('1876', '梁竹', '13802880529', '10', '1', '/public/uploads/imgs/head/1575207568.png', '/public/uploads/imgs/emoticon/默认表情包.jpg', '监控分析室', '分析组', '女', '21015702', 'liangzhu', '																								1、负责监控分析室工作质量分析与管控，对标先进，健全工作指标评估体系；\r\n2、负责国际光传送网、云数据中心、西藏省网网络分析，挖掘问题隐患，联合开展网络优化 ；\r\n3、负责云数据中心投诉集中处理点的管理，包括客户投诉/服务请求/咨询的协调管理及质量把控、工单处理、信息发布管理、服务质量分析、培训及考核等；\r\n4、负责牵头开展网管支撑中心各专业应急保障工作，包括事前组织方案，事中协调支撑，事后评估优化；\r\n5、负责监控分析室综合支撑服务，包括班组文化建设、材料编写、信息报送、流程管理、文档管理、新闻宣传、后勤保障等。																		', '2019-10-21 10:09:13', '2021-08-24 11:13:39');
