INSERT INTO `member` VALUES ('1885', '黄宏栋', '13802881019', '5', '1', '/public/uploads/imgs/head/1575207694.png', '/public/uploads/imgs/emoticon/默认表情包.jpg', '监控分析室', '传输支撑组', '男', '21010527', 'huanghongdong', '								1、负责国际光传送网境内侧、及国际政企专网7×24小时集中监控管理技术支撑、性能及运行情况分析、组织开展相关维护与优化工作；\r\n2、负责国际电路、国际政企专网政企专线投诉的一点集中处理技术支撑及售中开通技术支撑；\r\n3、负责维护和管理部署于南方基地的国际与省际的传输网管及其DCN；\r\n4、负责执行总部交办的专项工作；\r\n5、负责组织开展提升国际及国际政企专网传输监控及分析工作效率的支撑手段建设研究；\r\n6、负责室内传输专业人才培养；\r\n7、负责南方基地园区传输网络的维护与优化服务以及管道和光缆纤芯等管线资源的调度与施工等工作。						', '2019-10-21 10:09:13', '2021-11-15 15:58:06');
